Map::~Map()
{
    delete ground;

    for (int i = 0; i < 3; i++)
    {
        delete background[i];
        delete farground[i];
    }
}

void Map::Draw(sf::RenderWindow &window) const
{
    for (int i = 0; i < 3; i++)
        farground[i]->draw(window);

    for (int i = 0; i < 3; i++)
        background[i]->draw(window);

    window.draw(*ground);
}

void Map::moveBackgroundParallax(sf::Vector2f viewPosition)
{
    if (isInit)
    {
        isInit = false;
        previousViewPosition = viewPosition;

        background[MIDDLE]->getSprite().setPosition(viewPosition.x, viewPosition.y - 200);
        farground[MIDDLE]->getSprite().setPosition(viewPosition.x, viewPosition.y - 200);

        background[LEFT]->getSprite().setPosition(background[MIDDLE]->getSprite().getPosition().x - background[MIDDLE]->getSprite().getTextureRect().width, background[MIDDLE]->getSprite().getPosition().y);
        background[RIGHT]->getSprite().setPosition(background[MIDDLE]->getSprite().getPosition().x + background[MIDDLE]->getSprite().getTextureRect().width, background[MIDDLE]->getSprite().getPosition().y);

        farground[LEFT]->getSprite().setPosition(farground[MIDDLE]->getSprite().getPosition().x - farground[MIDDLE]->getSprite().getTextureRect().width, farground[MIDDLE]->getSprite().getPosition().y);
        farground[RIGHT]->getSprite().setPosition(farground[MIDDLE]->getSprite().getPosition().x + farground[MIDDLE]->getSprite().getTextureRect().width, farground[MIDDLE]->getSprite().getPosition().y);
    }
    else
    {
        sf::Vector2f pos = viewPosition - previousViewPosition;
        previousViewPosition = viewPosition;

        movePlan(background[MIDDLE], background[LEFT], background[RIGHT], viewPosition, pos.x * backgroundSpeed);
        movePlan(farground[MIDDLE], farground[LEFT], farground[RIGHT], viewPosition, pos.x * fargroundSpeed);
    }
}

void Map::movePlan(SfmlImage *planMiddle, SfmlImage *planLeft, SfmlImage *planRight, sf::Vector2f viewPosition, float moveSpeed)
{
    planMiddle->getSprite().move(moveSpeed, 0);
    planLeft->getSprite().move(moveSpeed, 0);
    planRight->getSprite().move(moveSpeed, 0);

    if (Vector2D::Distance(planLeft->getSprite().getPosition(), viewPosition) <
        Vector2D::Distance(planMiddle->getSprite().getPosition(), viewPosition))
    {
        planRight->getSprite().setPosition(planMiddle->getSprite().getPosition());
        planMiddle->getSprite().setPosition(planLeft->getSprite().getPosition());
        planLeft->getSprite().setPosition(planLeft->getSprite().getPosition().x - planMiddle->getSprite().getTextureRect().width, planLeft->getSprite().getPosition().y);
    }

    else if (Vector2D::Distance(planRight->getSprite().getPosition(), viewPosition) <
             Vector2D::Distance(planMiddle->getSprite().getPosition(), viewPosition))
    {
        planLeft->getSprite().setPosition(planMiddle->getSprite().getPosition());
        planMiddle->getSprite().setPosition(planRight->getSprite().getPosition());
        planRight->getSprite().setPosition(planRight->getSprite().getPosition().x + planMiddle->getSprite().getTextureRect().width, planRight->getSprite().getPosition().y);
    }
}
